import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import { Line } from "react-chartjs-2";
import { UncontrolledDropdown, DropdownToggle, DropdownMenu, DropdownItem } from 'reactstrap';
import {
  Card,
  CardHeader,
  CardBody,
  CardFooter,
  CardTitle,
  Row,
  Col,
} from "reactstrap";

export default class NewPatient extends React.Component {

    constructor(props) {
      super(props);
      this.state = {
          my_rows: [],
          total_pills: 0,
          total_pills_took: 0,
          total_pills_not_took: 0,
          patients : [],
          pills_not_took: [],
          next_pill: {},
          name_patient: ""
      }

    }


    render() {

        return (
            <>
                <div className="content">
                    <Row>
                    <Col >
            <Form onSubmit={handleSubmit}>
                <Col md="4"  form>
                    {/* UserName */}

                        <label htmlFor="feFirstName">Username</label>
                        <Input
                            id="feFirstName"
                            placeholder=""
                            name="username"
                            onChange={(e)=>setUsername(e.target.value)}
                        />

                    {/* PassWord */}

                        <label htmlFor="feLastName" style={{marginTop:"30px"}}>Password</label>
                        <Input
                            id="feLastName"
                            type="password"
                            placeholder=""
                            name="password"
                            onChange={(e)=>setPassword(e.target.value)}
                        />

                    <Button theme="accent"  style={{marginLeft: "70px", marginTop:"30px"}}>Log in</Button>

                    <Button theme="accent" style={{marginLeft: "20px", marginTop:"30px"}}>Sign Out</Button>
                </Col>

            </Form>
        </Col>
                    </Row>
                </div>
            </> 
            )
    }
}
